import * as React from "react";
import ToggleButton from "@mui/material/ToggleButton";

export function SeenItToggle() {
  const [selected, setSelected] = React.useState(false);

  return (
    <ToggleButton
      value="check"
      selected={selected}
      onChange={() => {
        setSelected(!selected);
      }}
    >
      Hide Watched Movies
    </ToggleButton>
  );
}


export function StreamItToggle() {
  const [selected, setSelected] = React.useState(false);

  return (
    <ToggleButton
      value="check"
      selected={selected}
      onChange={() => {
        setSelected(!selected);
      }}
    >
      Show Streamable Movies
    </ToggleButton>
  );
}
